DECLARE

	-- Identificador de un formato
	nuFormatId          ed_formato.formcodi%type;

BEGIN
--{
	if ( not CONFEXME_36.boProcessStatusOK ) then
	--{
		-- No realiza nada
		return;
	--}
	end if;

	-- Se obtiene código del formato con el identificador especificado
	open CONFEXME_36.cuFormat( 162 );
	fetch CONFEXME_36.cuFormat into nuFormatId;
	close CONFEXME_36.cuFormat;

	-- Se verifica si existe un formato con el delimitador especificado, en cuyo caso se elimina
	if ( nuFormatId is not NULL ) then
	--{
		-- Se establece el identificador para el formato
		CONFEXME_36.rcED_Formato.formcodi := nuFormatId;

		-- Se actualiza la información del formato
		UPDATE ED_Formato
		SET    formdesc = 'LDC_CAMBIO_DE_CONDICIONES',
		       formtido = 66,
		       formiden = '<162>',
		       formtico = 49,
		       formdein = '<LDC_CAMBIO_DE_CONDICIONES>',
		       formdefi = '</LDC_CAMBIO_DE_CONDICIONES>'
		WHERE  formcodi = CONFEXME_36.rcED_Formato.formcodi;
	--}
	else
	--{
		-- Se genera un identificador para el formato
		CONFEXME_36.rcED_Formato.formcodi := 162 ;

		-- Se inserta el formato
		INSERT INTO ED_Formato
		(
			formcodi,
			formdesc,
			formtido,
			formiden,
			formtico,
			formdein,
			formdefi
		)
		VALUES
		(
			CONFEXME_36.rcED_Formato.formcodi,
			'LDC_CAMBIO_DE_CONDICIONES',
			66,
			'<162>',
			49,
			'<LDC_CAMBIO_DE_CONDICIONES>',
			'</LDC_CAMBIO_DE_CONDICIONES>'
		);
	--}
	end if;

EXCEPTION

	when OTHERS then
		CONFEXME_36.boProcessStatusOK := FALSE;
		ROLLBACK;
		UT_Trace.Trace( 'ERROR -> ' || sqlerrm, 5 );
		raise;
--}
END;
