	nuNextSeqValue := GE_BOSequence.NextGe_Statement;
	CONFEXME_36.tbrcGE_Statement( '120083738' ).statement_id := nuNextSeqValue;

	UT_Trace.Trace( 'Insertando Sentencia [LDC_CAMBIO_CONDICIONES]', 5 );
	INSERT INTO GE_Statement
	(
		statement_id,
		module_id,
		description,
		statement,
		name
	)
	VALUES
	(
		CONFEXME_36.tbrcGE_Statement( '120083738' ).statement_id,
		5,
		'LDC_CAMBIO_CONDICIONES',
		'SELECT (b.subscriber_name||'' ''||b.subs_last_name||'' ''||
        b.subs_second_last_name)                                        CLIENTE
        , b.identification                                              IDENTIFICACION
        ,s.susccodi                                                     CONTRATO
      ,(a.address ||''  ''||
         (select x.description
            from ge_geogra_location x
            where x.geograp_location_id = a.neighborthood_id))          DIRPROYECTO
      ,pa.package_id                                                    SOLICITUD
      ,cu.cupotipo                                                      TIPOCUPON
      ,decode(cu.cuponume, null, ''No se ha generado Cupon'', cu.cuponume)CUPON
      ,decode(cu.cupovalo, null, ''No se ha generado Cupon'', ''$''||to_char(cu.cupovalo, ''FM999,999,999''))VALOR
      ,to_char(pa.expect_atten_date,''DD-MON-YYYY'')                      VALIDOHASTA
