    AND cu.cuponume = fr.coupon_id
    and cu.cupotipo = ''FI''
    and s.susccodi = cu.cuposusc
    and b.subscriber_id = s.suscclie
    and a.address_id = s.SUSCIDDI
    and g.geograp_location_id = a.geograp_location_id
    and fr.package_id = pa.package_id
    AND rownum = 1',
